import React from 'react';
import Moment from 'react-moment';
import momentjs from 'moment';

class Modified extends React.Component {
    render() {
        const r = <Moment date={this.props.LastModifiedTime} durationFromNow unit="days" />;
        var d = momentjs(this.props.LastModifiedTime);
        var dateDiff = momentjs().diff(momentjs(this.props.LastModifiedTime), 'days');
        if (dateDiff > 18 ){
            console.log(dateDiff, "more than 18");
        } else if (dateDiff > 9){
            console.log(dateDiff, "between 9 and 18");
        } else {
            console.log(dateDiff, "less than 9");
        }


        //<span className="badge badge-light">last modifed <Moment fromNow>{this.props.LastModifiedTime}</Moment></span>;
        return r;
    }
}

export default Modified;
